import { useAccordionToggle } from 'react-bootstrap/AccordionToggle';
import Accordion from 'react-bootstrap/Accordion';
import { Link, useHistory } from 'react-router-dom';

import api from '../../services/api';
import './style.css';

export default function ProgCientifica(){

    const [events, setEvents] = useState([]);
    const decoratedOnClick = useAccordionToggle(eventKey, onClick);

    useEffect(() => {
        api.get('', { /*headers: { Authorization: eventId }*/ })
            .then(response => {
                console.log(response);
                setEvents(response.data);
            })
    }, ); 

    return(

        <div className="event-container">
            <div className="top-header">
                <h1>Programação <br/> Científica <span>.</span></h1>
            </div>

            {/* <div className="event-section">
                <ul>
                    {events.map(event => (
                        <li key={event.PalestraId}>
                            <strong>Palestrante:</strong>
                            <p>{event.PalestranteNome}</p>

                            <strong>Título:</strong>
                            <p>{event.DescricaoAtividade}</p>

                        </li>
                    ))}
                </ul>
            </div> */}

            <Accordion defaultActiveKey="0" className="event-section">
                <Card>
                    <Card.Header>
                    <Accordion.Toggle as={Button} variant="link" eventKey="0">
                        Click me!
                    </Accordion.Toggle>
                    </Card.Header>
                    <Accordion.Collapse eventKey="0">
                        <ul>
                            {events.map(event => (
                                <li key={event.PalestraId}>
                                    <strong>Palestrante:</strong>
                                    <p>{event.PalestranteNome}</p>

                                    <strong>Título:</strong>
                                    <p>{event.DescricaoAtividade}</p>

                                </li>
                            ))}
                        </ul>
                    </Accordion.Collapse>
                </Card>
                <Card>
                    <Card.Header>
                    <Accordion.Toggle as={Button} variant="link" eventKey="1">
                        Click me!
                    </Accordion.Toggle>
                    </Card.Header>
                    <Accordion.Collapse eventKey="1">
                    <Card.Body>Hello! I'm another body</Card.Body>
                    </Accordion.Collapse>
                </Card>
            </Accordion>

        </div>

    ) 
}
